import { render } from '@testing-library/react';
import React from 'react';
import { Link } from 'react-router-dom';
import Main from './main';

const Dashboard = () => {

    const handleChange = (userChoice) => {
        render(
            <>
            <Main Uchoice={userChoice}/>
            </>
        )
    }


    return(
        <>
        <h1>Dashboard</h1><hr />
        <h1>Tic Tac Toe</h1><hr style={{width:"20%", marginLeft:"40%"}}/>
        <div className='container'>
            <Link className='btn btn-warning'>Single Player</Link><hr style={{width:"10%", marginLeft:"45%"}} />
            <Link className='btn btn-danger'>Multi Player</Link>
        </div>
        </>
    )
}


export default Dashboard;
